Messages are ordinary structs, they do not require any odin_actor specific overhead other than that they for obvious reasons have to be Send and have to implement Debug (odin_actor requirement to support debug/logging). The odin_actor crate does define a number of system messages for lifetime control and monitoring purposes (_Start_, _Pause_, _Resume_, _Timer_, _Exec_, _Ping_, _Terminate_). Those messages do not have to be handled explicitly by actors (although they can, should the actor require specific actions). System messages can be sent to any actor. Message sets are the complete message interfaces of their associated actors. They are implemented as enums since we want to be able to statically (at compile time) check that an actor processes all message types in its interface (no "forgotten" messages) we can only send messages to actors who have this message type in their interface Other than for actor definition message set enums are mostly transparent, which means they need From<msg-type> impls for all their variants. Message sets have to include the system messages mentioned above. Since this would be tedious to define explicitly we provide the define_actor_msg_set!(..) macro that can be used like so: use odin_actor::prelude::*; #[derive(Debug)] struct MsgA(usize);
