impl From<MsgB> for MyActorMsg {...}
... The macro also adds variants for the system messages so that we can send them to each actor. Apart from automatic From<..> impls the main operation performed on message set enums is matching their variants inside of actor receive() functions. To avoid boilerplate and to make the code more readable we provide support matching on variant types from within the impl_actor! {..} macro: impl_actor! { match msg for Actor<MyActor,MyActorMsg> as MsgA => cont! { // process msg: MyActorMsg::MsgA } ... _Start_ => cont! { // process msg: MyActorMsg::_Start_ } However, Rust enum variants are not types, hence the framework automatically has to map type names (from the match arm patterns) to variant identifiers, which requires name mangling in case of generic types and tuples. This name mangling is performed automatically and uses similar valid unicode identifier characters (see odin_macro implementation) to ensure that compiler error messages are still readable. It should be noted that since we use enums to define message sets developers should be aware of the variant type sizes - Rust enums are sized to accommodate the largest of their variants and mailboxes represent arrays of respective message set enums. Use Arc<MyLargeType> in case variants can get large.

