This leaves us the (bi-directional) processing of websocket messages, which is not hard-coded but implemented as a SpaService / JS module pair itself: odin_server::WsService and odin_server/assets/ws.js. As a general principle we only exchange JSON messages over the websocket. Each message uses the following JSON format: { "mod": "<service name>", "<msg-name>": <payload value> } (e.g. { "mod": "odin_goesr::GoesrService", "hotspots": [...] } in the above example). The mod field is used on both the server- and the client-side to filter/route it to its respective service/JS module, i.e. it effectively creates a service specific namespace for messages. 3.3.1 SpaService websocket handling On the server side this entails a SpaService::handle_ws_msg(..) implementation for incoming messages (sent by the JS module): impl SpaService for MyService { ... async fn handle_ws_msg (&mut self, hself: &ActorHandle<SpaServerMsg>, remote_addr: &SocketAddr, ws_msg_parts: &WsMsgParts) -> OdinServerResult<WsMsgReaction> { if ws_msg_parts.mod_path == ShareService::mod_path() { match ws_msg_parts.msg_type { "myMessage" => ... ... } } }
} The WsMsgParts is a helper type that already breaks out the mod_path, msg_type and payload string slices of the incoming message text. Sending messages from the service to the client has to go through the SpaServer, i.e. is done by sending any one of the following actor messages to it: BroadcastWsMsg sends a websocket message to all currently connected (browser) clients SendAllOthersWsMsg sends to all but one (usually the sender client) websocket connection SendGroupWsMsg sends to a explicitly provided set of websocket connections SendWsMsg sends only to one explicitly specified websocket connection Each of these types store the websocket message as a generic String field, i.e. the message can be assembled manually. To avoid mistakes and cut boiler plate code we provide a pub struct WsMsg<T> { pub mod_path: &'static str, // this is composed of crate_name/js_module (e.g. "odin_cesium/odin_cesium.js") pub msg_type: &'static str, // the operation on the payload pub payload: T
} helper construct for serialization that can be used like so: let msg = WsMsg::json(ShareService::mod_path(), "myMessage", payload)?; hserver.send_msg( BroadcastWsMsg{ data: msg}).await; The payload serialization/deserialization is usually done by means of the serde_json crate. 3.3.2 JS module websocket processing On the client (browser) side websocket messages come in through the odin_server/assets/ws.js JS module (if odin_server::WsService is used), which is responsible for dispatching the message to the JS module that registered for the mod property of the message object. JS module websocket handlers are functions that take two arguments - the name of the message (a string) and the Javascript object that is deserialized from the payload value: function myHandler (msgTypeName, msgObj) {..} This means deserialization if automatically done in ws.js - the receiving JS module does not have to call JSON.parse(..). The JS module recipient has to provide the message handler function and register it like so: ...
