import * as main from "../odin_server/main.js";
... ...main.getSharedItem(key)... The shared types are GeoPoint and GeoPoint3 for 2- and 3-dimensional geographic coordinates GeoLine and GeoLineString for geographic polylines LineString3 for ECEF (xyz) trajectories GeoRect for parallel/meridian aligned rectangles of geographic coordinates GeoPolygon for general geographic coordinate polygons GeoCircle and GeoCylinder for geographic circles and cylinders String for text data I64 and F64 for numeric integer and float values Json for text data that is supposed to be parsed as JSON , i.e. is a "catch-all" format for arbitrary objects Each of these types has a respective type name constant (e.g. GEO_LINE) that can be used to identify the type. Instances of these types can be shared locally or globally, and are identified through an associated pathname (path elements separated by '/'). The basic abstraction for this is the SharedItem(key,isLocal,value). Shared values can be further annotated by having a comment and an owner. The abstract storage model for shared items is a general key/value store, i.e. SharedItems are identified through their respective keys (pathnames). The main API to access shared items is getSharedItem (key) - to get a specific shared item with known key getAllMatchingSharedItems (regex) - to get a set of shared items through key patterns setSharedItem (key, valType, data, isLocal=false, comment=null) - to create, store and share a value removeSharedItem(key) - to purge a shared value from the store Changes to the shared item store are broadcasted to registered listeners, i.e. if a JS module needs to know of such changes it has to register: ...
