How do we use a SharedStore within an ODIN server? While SharedStore implementors could be global they are inherently mutable and hence a global store would require locking patterns such as: use std::sync::{LazyLock,RwLock}; ... static MY_STORE: LazyLock<RwLock<MyStore>> = ... Moreover, since the shared-ness is a critical aspect we also require a notification mechanism that allows callbacks on mutable clients once a store changes, which makes the use of global objects quite unwieldy (especially in an async context). Hence our primary use of SharedStore instances is the actor : pub struct SharedStoreActor<T,S,A> where T: SharedStoreValueConstraints, S: SharedStore<T>, A: DataAction<SharedStoreChange<T>> { store: S, change_action: A, ...
} define_actor_msg_set! { pub SharedStoreActorMsg<T> where T: SharedStoreValueConstraints = SetSharedStoreValue<T> | RemoveSharedStoreValue | Query<String,Option<T>> | ExecSnapshotAction<T>
} To make the SharedStoreActor type re-usable across different application domains we parameterize it not only with the store item type T, the store type S but also with a generic odin action type A of a actor constructor parameter which defines the "callback" actions to be performed when the store changes. Upon store mutation this odin_action::DataAction is executed with a pub enum SharedStoreChange<T> where T: SharedStoreValueConstraints { Set { hstore: ActorHandle<SharedStoreActorMsg<T>>, key: String }, Remove { hstore: ActorHandle<SharedStoreActorMsg<T>>, key: String }, ...
} parameter which can be sent to other actors. Recipients of such SharedStoreChange messages can then use its hstore actor handle to query the changed store values by sending a Query<String,Option<T>> query message to the store actor, or by sending a struct ExecSnapshotAction<T>( pub DynSharedStoreAction<T> ) message to the store with an action trait object that will be executed by the store with its own SharedStore<T> trait object parameter. These patterns look like so in a client actor using the store: use odin_actor::prelude::*;
use odin_share::prelude::*; enum StoreItem {...} struct Client {...} #[derive(Debug)] struct SomeClientMsg (ActorHandle<SharedStoreActorMsg<StoreItem>>);
define_actor_msg_set! { ClientMsg = SharedStoreChange<StoreItem> | SomeClientMsg } impl_actor! { match msg for Actor<Client,ClientMsg> as SharedStoreChange<StoreItem> => cont! { // store has changed, query value match msg { SharedStoreChange::Set{ hstore, key } => { println!("client received update for key: {:?}, now querying value..", key); match timeout_query_ref( &hstore, key, secs(1)).await { Ok(response) => match response { Some( value ) => ... } } } ... } } ... SomeClientMsg => cont! { // iterate over store items let action = dyn_shared_store_action!( => |store as &dyn SharedStore<StoreItem>| { for (k,v) in store.ref_iter() { ... // process key-value items } Ok(()) }); msg.0.send_msg( ExecSnapshotAction(action)).await; }
} The actor system construction in turn uses the change action to register clients in the store: use odin_actor::prelude::*;
use odin_share::prelude::*; run_actor_system!( asys => { let client = PreActorHandle::new( &asys, "client", 8); let hstore = spawn_actor!( asys, "store", SharedStoreActor::new( HashMap::new(), data_action!( let client: ActorHandle<ClientMsg> = client.to_actor_handle() => |update: SharedStoreChange<StoreItem>| Ok( client.try_send_msg( update)? ) ) ))?; ... let client = spawn_pre_actor!( asys, client, Client::new(...))?; ... Ok(())
} See the enum_store.rs example for further details.

